import React from 'react';
import Statistics from './StatElement';

const StatisticsList = ({ stats }) => (
    <ul>
        {stats.map((stat) => (
            <li key={stat.id}>
                < Statistics
                    label={stat.label}
                    percentage={stat.percentage}
                />
            </li>
        ))}
    </ul>);

export default StatisticsList;
